INSERT INTO `project_info` VALUES (1,'2014-04-14 06:06:06','user','刘卉','投资商业地产','投资商业地产','由某某企业做担保','宝盈238','transaction_management','宋天乙','胡安亚','2014-08-04 15:13:15','admin',3,1),(2,'2014-05-14 06:06:06','admin','王小明','18','投资光伏发电','由某某区政府做担保','富诚39','non_transaction_management','李亮','张倩','2014-05-14 06:06:06','admin',1,2),(3,'2014-07-30 18:39:27','admin','',NULL,'','','富诚39','non_transaction_management','','','2014-07-31 14:28:16','admin',5,3),(4,'2014-08-04 15:17:42','admin','唐丽媛','8.8%/年','信托资金以贷款方式贷放给郑州市金水区非税收入征收管理局，由其用于杨金产业园区内的道路等基础设施建设。','河南省金水投资管理有限公司提供连带责任保证。','百瑞富诚88号集合资金信托计划（杨金产业园区基础设施建设）','non_transaction_management','陈飞','张宁','2014-08-04 15:47:55','admin',9,4),(5,'2014-08-04 16:21:13','admin','唐丽媛','9.5%/年','信托计划成立后，受托人按照委托人意愿，将信托计划本金以贷款形式发放给济源市济康科技有限公司（以下简称借款人或济康科技），由其用于富士康济源虎岭工业园项目的建设。','河南省济源市建设投资公司自愿将其合法持有的华能沁北发电有限责任公司5%的股权（对应出资额为人民币4,050万元）提供质押担保。','百瑞富诚89号集合资金信托计划（济源富士康）','non_transaction_management','李小莉','胡安亚','2014-08-04 16:21:34','admin',4,5),(6,'2014-08-04 16:26:52','lixue','唐丽媛','受益人年预期收益率为1年期：9.3%/年，2年期:期限 单份信托合同项下信托资金','受益人年预期收益率为1年期：9.3%/年，2年期:期限 单份信托合同项下信托资金金额 \r\n2年期 300万元以下（不含） 9.5%/年\r\n 300万元以上（含） 10.3%/年\r\n ','世诚裕润（1）回购义务人自愿将特定股权提供质押担保。\r\n（2）美景集团实际控制人王小兴提供连带责任保证。','宝盈341号美景集团股权收益权项目','non_transaction_management','李小莉','胡安亚','2014-08-04 17:24:06','lixue',8,6),(7,'2014-08-04 16:42:51','lixin','李坤','9','信托资金贷放给广西滨海城市建设发展有限公司，用于广西钦州市扬帆大道南延长线工程建设。','天津滨海发展投资控股有限公司提供连带责任保证。','百瑞富诚127号集合资金（广西钦州杨帆大道项目）','non_transaction_management','李小莉','吴文彬','2014-08-04 16:46:40','lixin',6,7),(8,'2014-08-04 16:52:36','loubingxun','刘卉','8.625','信托贷款本金以贷款的方式贷放给新发展公司，用于新发展公司承建的郑州市航空港区综合保税区内富士康“L地块”厂房及配套设施','郑州新区建设开发投资总公司（以下简称：新区建投）以其持有的位于郑州市中牟县官渡镇韩庄村西的面积为1,342,975.37平方米的工业用地国有土地使用权【土地使用权证号：牟国用（2010）第239号】向受托人提供抵押担保。','百瑞富诚60号集合资金信托计划（郑州航空港区富士康项目）','non_transaction_management','李小莉','孙雪蕾',NULL,NULL,1,8),(9,'2014-08-04 17:33:26','wangzhen','宋楠','','计划本金以贷款方式一次或分次发放给开封市兰尉高速公路发展有限公司，用于补充添置兰尉高速公路多路径识别系统、高速公路日常维护、周期性大修等所需的流动资金。','兰尉高发公司以其持有的日照至南阳高速公路兰考至尉氏路段高速公路收费权提供质押担保；河南海菱实业发展有限公司自愿以其合法所有的全部资产提供连带责任保证。','百瑞宝盈255号集合资金信托计划 （兰尉高速）','non_transaction_management','李小莉','薛杉','2014-08-12 18:32:24','wangzhen',3,9),(10,'2014-08-05 16:30:54','admin','唐丽媛','','','','富诚39','non_transaction_management','李小莉','胡安亚',NULL,NULL,1,10),(11,'2014-08-07 17:39:31','lixue','唐丽媛','1年期9%/年，2年期单份合同委托金额在100万元（含）至300万元（不含）的为','资金运用方式：信托计划成立后，受托人按照委托人意愿，信托资金用于购买众泰控股集团有限公司持有的浙江众泰汽车制造有限公司100%股权（对应出资额为人民币10,180万元）的收益权。','保障措施：\r\n（1）众泰集团以其持有的众泰汽车制造100%股权向受托人提供质押担保。按照众泰汽车2013年11月30日的净资产计算，特定股权价值共计人民币204,911.68万元；\r\n（2）杭州润辰置业有限公司将其持有的位于浙江省淳安县千岛湖镇排岭半岛金紫度假村北侧的面积为69,639.16平方米的商住用地使用权【土地使用证号为淳安国用（2011）第02869号】向受托人提供抵押担保，该抵押物评估价值为人民币27,361.23万元；\r\n（3）铁牛集团有限公司以其全部财产提供连带责任保证。\r\n','百瑞宝盈178号集合资金信托计划（众泰汽车股权收益权）','non_transaction_management','李小莉','赛攀','2014-08-07 18:13:00','lixue',8,11),(12,'2014-08-07 17:44:46','lixue','唐丽媛','333','333','3333','33','non_transaction_management','李小莉','胡安亚',NULL,NULL,0,12),(13,'2014-08-07 17:55:06','lixue','唐丽媛','预期收益率为10%/年','信托计划资金用于购买汝阳杜康酿酒有限公司（以下简称汝阳杜康）持有的750吨酒祖杜康12区窖藏酒成品酒（以下简称特定白酒）的收益权（以下简称特定白酒收益权）。信托计划到期前，汝阳杜康按照约定溢价回购信托计划项下的特定白酒收益权，回购价款包括溢价款和受让款。','（1）汝阳杜康以其合法持有的800吨酒祖杜康12区窖藏酒成品酒（包含750吨特定白酒）提供抵押担保；\r\n（2）洛阳杜康控股有限公司、郑州黄河大观有限公司、汝阳杜康的法定代表人高峰、实际控制人李伟均自愿以其各自合法所有的全部财产提供连带责任保证。\r\n','百瑞宝盈198号集合资金信托计划（酒类收益权投资基金-酒祖杜康12区窖藏酒）','non_transaction_management','李小莉','薛杉','2014-08-08 15:35:20','lixue',7,13),(14,'2014-08-07 17:58:44','lixue','唐丽媛','10.5%/年','受托人按照委托人意愿，将信托计划本金用于购买河南平原控股集团股份有限公司（以下简称平原控股）持有的郑州泰阳纺织有限公司（已更名为郑州三棉纺织有限公司）（以下简称三棉纺织）约96.87%股权（对应出资额13,731万元）的收益权。信托计划到期前，平原控股按照约定溢价回购特定股权收益权。','（1）平原控股将其持有的郑州三棉纺织有限公司约96.87%股权（对应出资额13,731万元）向受托人提供质押担保，根据三棉纺织2013年12月报表净资产计算对应价值为36,429.04万元；\r\n（2）三棉纺织将其持有的位于郑州市化工路北、紫竹路西的面积为162,087.2平方米的工业用地使用权【土地使用证号为郑国用（2008）第0206号】向受托人提供抵押担保，根据河南省中地联合评估咨询有限公司出具的编号为（郑州）中地（2012）（估）字第190号的《土地估价报告》（估价基准日：2012年11月14日）显示，该抵押物评估价值为人民币11,718.90万元；\r\n（3）三棉纺织将229台纺织生产设备向受托人提供抵押担保。根据河南豫财资产评估有限公司出具的豫财评报字[2012]第1114号的《资产评估报告》（估价基准日：2012年10月31日）显示，该抵押物评估价值为人民币17,067.44万元。本计划综合抵押率为18.34%。\r\n','百瑞宝盈242号集合资金信托计划（泰阳纺织股权收益权）','non_transaction_management','李小莉','薛杉','2014-08-08 15:35:02','lixue',8,14),(15,'2014-08-07 18:06:37','lixue','唐丽媛','1.5年期和2年期均为9%/年','将信托计划本金以贷款方式发放给鹤壁市四季青农产品批发市场（以下简称鹤壁四季青或借款人），用于鹤壁四季青农产品批发市场家居广场内6#、7#、8#、9#楼的室内装修。','为防止信用风险，本信托计划设计了多重防范措施：\r\n（1）鹤壁四季青以其合法持有的位于鹤壁市淇滨区九州路南侧、老107东侧四季青农产品批发市场家居广场内的1#楼、5#楼共计20431.41平方米的房屋所有权【房产证号：鹤房权证市字第1201010208号、鹤房权证市字第1201010219号】及对应的商业用地使用权向受托人提供抵押担保。根据河南省豫建房地产评估咨询有限公司出具的《房地产估价报告》（估价报告编号：豫郑豫建评字[2013]01001B号，估价时点：2013年1月6日），上述房屋评估总价为人民币16,426.85万元，抵押率48.7%。\r\n（2）借款人法定代表人李东顺的配偶董雪香提供连带责任保证。\r\n','百瑞宝盈249号集合资金信托计划（鹤壁四季青）','non_transaction_management','李小莉','姚楠','2014-08-07 18:08:02','lixue',3,15),(16,'2014-08-07 18:09:27','lixue','唐丽媛','1.5年期，单份信托合同项下信托资金金额在100万元（含）以上300万元以下（不','信托计划成立后，受托人按照委托人意愿，将信托计划资金以债权方式发放给河南财鑫集团有限责任公司（以下简称财鑫集团或借款人），用于补充其在生产经营过程中的流动资金需求。','为保障信托计划安全，项目设立了多重防范措施：\r\n（1）万隆置业以其合法持有的位于菏泽市单县西外环北段路东万隆国际批发城A2#-A30#、B21#-B23#楼的商业物业所有权为信托贷款提供抵押担保，经单县新达房地产评估事务所（有限责任公司)评估，上述抵押物的评估价值为人民币59309.06万元，估价时点：2013年5月21日，评估报告编号为单新房估字第(B20130559)号。\r\n（2）财鑫化工为借款人如约履行本息偿还义务承担连带清偿责任，同时，借款人的实际控制人仵树仁提供连带责任保证。\r\n','百瑞宝盈323号集合资金信托计划（财鑫集团）','non_transaction_management','李小莉','杨绪强','2014-08-08 09:53:36','lixue',7,16),(17,'2014-08-08 09:44:08','lixue','胡斌','本信托不设预期收益，以本期信托财产运用产生的实际信托收益为准','信托基金成立后，受托人通过投资、贷款等多种方式将信托资金投放于郑汴新区，以获取投资收益。其中，第1期募集的信托资金用于投资目标公司河南新高地控股有限公司15%的股权。','受托人向项目公司派出董事、监事，参与项目公司的重大事项决策。','百瑞富诚郑汴区域发展信托基金1期','non_transaction_management','李小莉','王瑞晓','2014-08-08 15:37:13','lixue',6,17),(18,'2014-08-08 10:00:18','wangzhen','宋楠','年预期收益率约为13%','受托人按照委托人意愿，将信托计划本金以贷款形式贷放给河南建业足球俱乐部股份有限公司（以下简称建业足球俱乐部），由其用于补充购买球员、俱乐部训练及比赛场馆固定设施维护及其他经营所需的流动资金。','（1）受托人履行尽职管理义务，密切跟踪借款人的经营情况，关注其财务状况变化，督促其按时偿还信托计划贷款本息，本信托计划约定了信托终止时可采用原状返还的形式进行信托财产交付。\r\n（2）为防范借款人不能按时、足额偿还贷款本息的风险，胡葆森先生向受托人提供连带责任保证。','百瑞宝盈184号定向集合资金信托合同 （建业足球俱乐部）','non_transaction_management','李小莉','史倩颖','2014-08-12 18:30:50','wangzhen',3,18),(19,'2014-08-08 10:09:39','wangzhen','宋楠','11.7%/年','信托成立后，信托资金以贷款方式贷放给河南中联创，用于由其运用于橄榄城•都市广场（商业）项目的开发建设。','（1）借款人以其合法持有的位于郑州市佛岗东路南、冯庄路西的土地使用