展有限公司（以下简称忆通置业或借款人），用于新乡市针织厂棚户区改造工程项目（亦称“忆通未来城项目”）开发、建设。','（1）借款人以其持有的位于新乡市宏力大道628号、新国用（2011）第03019号土地证项下的41489.34平方米土地使用权向受托人提供抵押担保。根据河南省中地联合评估咨询有限公司出具的《土地估价报告》【报告编号：河南中地公司（2012）估字第274号，估价基准日：2012年12月11日】，上述土地使用权评估价值为10488.51万元。\r\n（2）借款人股东河南天丰投资发展有限公司将其持有的焦作市商业银行股份有限公司（以下简称焦作商行）4000万股股份向受托人提供质押担保。根据焦作商行截至2012年6月的财务报表，焦作商行每股净资产为1.39元，上述质押股份价值为5560万元。','百瑞富诚113号单一资金信托（新乡针织厂棚户区改造项目）','non_transaction_management','李小莉','吴文彬','2014-08-12 18:31:06','loubingxun',4,73),(74,'2014-08-12 18:32:53','loubingxun','李坤','300万以下为7.8%/年，300万（含）以上为8.1%/年','信托计划成立后，受托人按照委托人意愿，将信托计划本金以贷款方式发放给江苏嬉戏族有限公司（以下简称江苏嬉戏族或借款人），用于其“环球动漫嬉戏谷”项目的日常经营及游乐设施改善、扩建等。','（1）江苏武进经济发展集团有限公司提供连带责任保证；\r\n（2）江苏武进太湖湾旅游发展有限公司以其合法持有的位于常州市武进区雪堰镇、土地使用权证号为【武国用（2012）第01347号】土地项下的66668.7平方米土地使用权提供抵押担保；项目成立前，经江苏苏地仁合土地房地产评估咨询有限公司评估【估价报告编号：（苏）苏地仁合（2012）（估）字第366号，估价基准日：2012年12月25日】，抵押土地使用权评估价值为50508.21万元，项目成立时抵押率为55.44%。\r\n','百瑞富诚114号集合资金信托计划（环球数字文化园）','non_transaction_management','李小莉','白亚松','2014-08-12 18:40:01','loubingxun',4,74),(75,'2014-08-12 18:42:34','loubingxun','李坤','','信托计划成立后，受托人按照委托人意愿，将信托计划项下各期信托资金一次或分次用于购买郑州天地人和物业服务有限公司（以下简称天地人和或回购义务人）持有的位于郑州市金水区花园路111号天荣建材港市场（以下简称天荣建材港或租赁物业）的租赁收益权。信托计划到期前，天地人和按照约定溢价回购信托计划项下的租赁收益权，回购价款包括受让款和溢价款。信托计划项下3+1年期信托存续届满3年，天地人和可提前溢价回购全部租赁收益权。','（1）欣荣物业自愿以其合法持有的天地人和20%的股权向受托人提供质押担保。\r\n（2）瑞昊投资自愿以其合同持有的天荣地产20%的股权和龙马实业20%的股权向受托人提供质押担保。\r\n（3）黄河大观、天荣地产、龙马实业、天地人和的实际控制人梁中民自愿以其各自合法所有的全部财产向受托人提供连带责任保证。\r\n（4）天地人和的实际控制人梁中民承诺：在其个人和/或其实际控制企业或其关联企业、关联人等取得天地人和剩余80%股权（对应出资额人民币800万元整）后，其负责落实将该部分股权追加质押给受托人。目前该项已经办理完毕。\r\n','百瑞宝盈181号集合资金信托计划（天荣建材港）','non_transaction_management','李小莉','赛攀','2014-08-12 18:58:33','loubingxun',5,75),(76,'2014-08-12 19:01:31','loubingxun','刘卉','2年期6%/年，3年期为6.5%/年','信托成立后，受托人按照委托人要求，将信托资金以溢价增资的方式对洛阳龙门旅游集团有限公司进行股权增资，每1元出资额的增资价格为7元，其中金额为4285.7143万元的信托资金计入目标公司实收资本，其余资金计入目标公司资本公积。增资完成后百瑞信托持有龙门集团30%的股权，信托终止前，受托人根据委托人出具的指令，通过目标公司分红、股权转让等方式获取投资收益。','（1）由公司股东各派代表组成董事会，其中受托人委派1名董事，洛阳龙门石窟文化洛阳投资有限责任公司委派3名董事，龙门石窟世界文化遗产园区财政局委派1名董事，决定洛阳龙门旅游集团有限公司重大事项，重大事项需全体董事过半数表决同意后方可实施。\r\n（2）信托计划持股期间，洛阳龙门旅游集团有限公司分红不按照股东持股比例分红，由公司股东协商确认分红方式。\r\n（3）信托计划持股期间，洛阳龙门旅游集团有限公司发生股权变更时，需取得全体股东同意方可实施。\r\n（4）信托计划持股期间，当洛阳龙门旅游集团有限公司发生对外负债或担保行为时，需取得全体股东同意方可实施。\r\n（5）信托计划持股期间，当洛阳龙门旅游集团有限公司发生资产购买或转让且资产价值大于3000万元（含）时，需取得全体股东同意方可实施。\r\n','百瑞宝盈207号单一资金信托（旅游发展投资基金-洛阳龙门石窟）','non_transaction_management','李小莉','薛杉',NULL,NULL,0,76);
